import React from "react";
import styles from './p'

function PixelStory() {
    return (
      <div className="pixelstory">
        Benvenuti nella mia pagina: vogliotornàbambina. <br />
        Nel lontano 2005/7, possedevo un sito su Altervista, interamente creato
        da me. Il suo scopo era quello di "contenitore" per i miei disegni in
        pixel. <br />
        Qualche tempo fa, grazie ad uno snapshot, sono riuscita a reperirne lo
        scheletro. Speravo di riuscire a recuperare alcune delle mie creazioni ma
        purtroppo sono riuscita a trovare solo l'icona dell'index primordiale
        (ciò che avete appena cliccato per accedere a questa pagina). <br />
        Non essendo abituata alla docile resa, ho acquistato Aseprite e mi sono
        rimessa all'opera. <br />
        Ammetto di aver perso un po' di smalto ma è stato comunque divertente.{" "}
        <br />
        Qui sotto potete ammirare una battaglia (credo, non lo so, sono piuttosto
        indipendenti) tra alcune delle mie recenti creature.
      </div>
    );
  }

  export default PixelStory;
